import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

var Header = (props) => {
  return (
    <div className="header">
        <div><FontAwesomeIcon icon='globe-americas'/> Plan the Trip</div>
    </div>
  )
}

export default Header;
